network::~network() {
    if (mVcdFile) 
        sc_close_vcd_trace_file(mVcdFile);

    mHdltvinHandle << "] " << endl;
    mHdltvoutHandle << "] " << endl;
    mHdltvinHandle.close();
    mHdltvoutHandle.close();
    delete network_AXILiteS_s_axi_U;
    delete MemBank_B_U;
    delete MemBank_Out_U;
}

